import React from 'react'
import Card from './Card';
import Footer from './Footer';
import Carousel from './Carousel';
import Navbar from './Navbar';
import shopData from './dummyData';

const Home = () => {
  return (
    <div  >
      <div><Carousel /></div>
      <div className='m-3'><Card />
      <Card />
      <Card />
      <h1>shopData.length</h1>
      </div>

      <div><Footer /></div>

    </div>
  )
}

export default Home;
